import { ProTag, ProSpace } from '@fruits-chain/react-bailu'

const options = (
  ['primary', 'hazy', 'hazy-outline', 'ghost'] as ProTagProps['type'][]
).map(v => {
  return {
    value: v,
    label: v,
  }
})

const Demo: React.FC = () => {
  const [tagType, setTagType] = useState<ProTagProps['type']>(options[0].value)

  return (
    <ProSpace direction="vertical">
      <Radio.Group
        options={options as RadioGroupProps['options']}
        onChange={e => {
          setTagType(e.target.value)
        }}
        value={tagType}
        optionType="button"
      />

      <ProSpace wrap>
        <ProTag color="success" type={tagType}>
          \u5DF2\u5B8C\u6210
        </ProTag>
        <ProTag color="warning" type={tagType}>
          \u5F85\u5BA1\u6838
        </ProTag>
        <ProTag color="cancelled" type={tagType}>
          \u5DF2\u53D6\u6D88
        </ProTag>
        <ProTag color="danger" type={tagType}>
          \u5DF2\u9A73\u56DE
        </ProTag>
        <ProTag color="primary" type={tagType}>
          \u5BA1\u6838\u4E2D
        </ProTag>
        <ProTag color="#098" type={tagType}>
          \u81EA\u5B9A\u4E49\u989C\u8272\uFF08#098\uFF09
        </ProTag>
      </ProSpace>
    </ProSpace>
  )
}

export default Demo
